@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://example.com/atm#> .

atm:ATM rdf:type owl:Class .
atm:Transaction rdf:type owl:Class .
atm:Receipt rdf:type owl:Class .

atm:prints rdf:type owl:ObjectProperty ;
           rdfs:domain atm:ATM ;
           rdfs:range atm:Receipt .

atm:completes rdf:type owl:ObjectProperty ;
             rdfs:domain atm:ATM ;
             rdfs:range atm:Transaction .

atm:transactionHasReceipt rdf:type owl:ObjectProperty ;
                          rdfs:domain atm:Transaction ;
                          rdfs:range atm:Receipt .

atm:ATM rdfs:subClassOf [ rdf:type owl:Restriction ;
                          owl:onProperty atm:completes ;
                          owl:someValuesFrom atm:Transaction] .

atm:Transaction rdfs:subClassOf [ rdf:type owl:Restriction ;
                                  owl:onProperty atm:transactionHasReceipt ;
                                  owl:someValuesFrom atm:Receipt] .
